import React from "react";
import { Link } from "react-router-dom";

const cars = [
  { id: 1, name: "Lamborghini Huracan", price: "1,500,000 ₪" },
  { id: 2, name: "Ferrari F8 Tributo", price: "1,800,000 ₪" },
];

const CarsForSale = () => {
  return (
    <div className="cars-container">
      <h2>מכוניות למכירה</h2>
      {cars.map((car) => (
        <div key={car.id} className="car-card">
          <h3>{car.name}</h3>
          <p>מחיר: {car.price}</p>
          <Link to="/purchase">
            <button>קנה עכשיו</button>
          </Link>
        </div>
      ))}
    </div>
  );
};

export default CarsForSale;
